Halo Initiation 1

Before she was a supersoldier defending humanity as part of the Spartan IV program, Sarah Palmer was an ODST carrying out the most dangerous missions behind enemy lines! 

&quot;It will act as the origin story for Commander Sarah Palmer and the series will follow her career from her time as an Orbital Drop Shock Trooper to the leader of the SPARTAN-IVs aboard the UNSC Infinity.&quot;
